import React from "react"
import { Flex, Text, Box, Image, Row, Column } from "rebass"
import Table, { TableLine } from "./base-table"
export default props => {
	return (
		<Flex
			sx={{
				cursor: "pointer",
				background: "#FFF0E5"
			}}
		>
			<Table
				titles={[
					"PICTRUE",
					"PRODUCT INFOMATION",
					"PRICE",
					"DATE",
					"STYLE",
					"EDIT"
				]}
			></Table>
		</Flex>
	)
}
